import React, { Component } from 'react';
import PropTypes from 'prop-types';
import './PhoneIdentification.css';
import './AttractLoop.css';



class PhoneNumberIdentification extends Component{
    constructor(props){
        super(props);
    }
    handleTheKeyClicks = (id,value) => {
        alert(value);
    };
    render(){

        return(
            <div>
            <div className="AttractLoop" >
               <header className="AttractLoop-Header">
                  <h1> Savings & Coupons</h1>
               </header>
        </div>  
        <div className="messsgeDisplay">

        <h3>Enter the Phone number associated with the account</h3>
        <input class= "inputText"></input>
        <div id="container">
        <ul id="keyboard" >   
        <li class="letter" onClick={this.handleTheKeyClicks.bind('1',1)}>1</li>  
        <li class="letter" onClick={this.handleTheKeyClicks.bind('1',1)}>2</li>  
        <li class="letter" onClick={this.handleTheKeyClicks.bind('1',1)}>3</li>  
        <li class="letter clearl" onClick={this.handleTheKeyClicks.bind('1',1)}>4</li>  
        <li class="letter" onClick={this.handleTheKeyClicks.bind('1',1)}>5</li>  
        <li class="letter">6</li> 

        <li class="letter clearl">7</li>  
        <li class="letter ">8</li>  
        <li class="letter">9</li> 

        <li class="letter clearl"></li>
        <li class="letter">0</li>
        <li class="letter">&lt;</li>    
        <li class="switch">Submit</li>  

        </ul>
        </div>

        </div>



     </div>
        );
    };

}


export default PhoneNumberIdentification;
